import Layout from "../components/Layout";
import Tile from "../components/Tile";

const Home = () => (
    <Layout>
        <h1>Projects</h1>
        <br></br>
            <Tile h1="Statistics Calculator" 
            src={"/calculator.png"}
            title="Machine Learning"
            text="From the use of Python and various machine learning libraries, this section details
            two main projects. ">
            </Tile>

    </Layout>
);

export default Home;
